return(
    <>
     <input type="number" value={count} onChange={(e) => setCount(e.target.value)}/><br/>
    {/* <h1>{count}</h1> */}
    <button onClick={()=>{
        setCount(count+1);
    }}
    >increase</button>
    <button onClick={()=>{
        setCount(count-1);
    }}
    >decrease</button>
    </>
)
}
export default Counter;
